import React from 'react';
import './SlideBar.css';

const SlideBar = ({ onViewChange, activeView, user }) => {
  const handleViewClick = (view) => {
    onViewChange(view);
  };

  return (
    <div className="sidebar">
      {/* Sidebar Header */}
      <div className="sidebar-header">
        <div className="sidebar-title">
          <h3>‚öôÔ∏è Tools</h3>
          <p>Admin & Logs</p>
        </div>
      </div>

      {/* Sidebar Navigation */}
      <div className="sidebar-nav">
        <button
          className={`sidebar-nav-btn ${activeView === 'admin' ? 'active' : ''}`}
          onClick={() => handleViewClick('admin')}
        >
          <span className="nav-icon">üëë</span>
          <span className="nav-label">Admin Panel</span>
        </button>
        <button
          className={`sidebar-nav-btn ${activeView === 'logs' ? 'active' : ''}`}
          onClick={() => handleViewClick('logs')}
        >
          <span className="nav-icon">üìù</span>
          <span className="nav-label">Logs</span>
        </button>
      </div>
    </div>
  );
};

export default SlideBar;
